import React from 'react';

function Footer() {
  return (
    <footer id="footer" className="webFooter">
      <div className="footer-content">
        <div className="about-us">
          <h3>About Us</h3>
        </div>
        <div className="contact-us">
          <h3>Contact Us</h3>
        </div>
      </div>
    </footer>
  );
}

export default Footer;
